import { Resume } from './components/Resume/index';

function App() {
  // const [loaded, setLoaded] = useState(false);


  return (
    <>
      <Routes>
        <Navigation/>
          <Route exact path="/" element={<Homepage />} >
          </Route>
      </Routes>
    </>
  );
}

export default App;
